/**
 * @param {number[]} nums
 * @param {number} pivot
 * @return {number[]}
 */
var pivotArray = function(nums, pivot) {
    var before = [];
    var between = [];
    var after = [];

    nums.forEach((num) => {
        if (num > pivot) after.push(num);
        if (num < pivot) before.push(num);
        if (num == pivot) between.push(num);
    });
    return [...before, ...between, ...after];
};
